import React from 'react';
import Cards from '../src/Components/Cards'

function Service() {
  return (
    <>
      <div className='my-5'>
        <h1 className='text-center'>Our Services</h1>
      </div>
      <div className='container-fluid my-5'>
        <div className='row'>
          <div className='col-10 mx-auto'>
            <div className='row'>
            <Cards />
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default Service;
